<p style="text-align: justify;"><strong><span style="font-family: 'Cambria',serif;">Dubai All Hands Meet &ndash; organized on Aug 2018 &ndash; &nbsp;</span></strong><span style="font-family: 'Cambria',serif; color: black;">Mr. Sunil Bhatia and Mr. Eddie Chandhok spoke about Infogain's plan and target&nbsp;for FY2019, updated the Team behind the rational for new tag line "Engineering Business Outcomes", briefed the Team on Infogain's 4 core values, trends/technologies for future. Motivated the Team to cross-train themselves and adoption&nbsp;on modern age technologies, steps which Infogain has taken to cross-train the resources including conducting regular training etc.&nbsp; Mr. Manoj Mittal has updated the Team with his growth&nbsp;plans for region and congratulated the Team for all good work which is done in past. He also requested the Team for continuous support and more&nbsp;collaboration/focus to grow the region and assured his support and commitment towards Team.&nbsp; Executive Team also answered the various questions asked by Team during the event, followed by drinks and dinner.</span><u></u><u></u></p>
